#define N_KNN_ALPHABET 5
unsigned int loDist[N_KNN_ALPHABET];
unsigned int loId[N_KNN_ALPHABET];

void printArray(unsigned int *a, int sz)
{
    unsigned int *p = a;
    unsigned int i;
    for(i=0; i<sz; i++)
    {
         printf("%c  ", *(p++)+'A'-1);
    }

    printf("\n");
}

/*!
 * \brief return element in array 'a' that occurs the most.
 */
unsigned int majority(unsigned int *a, unsigned int sz)
{
    unsigned int i, j;
    unsigned int mId = 0, mN = 0;
    unsigned int tN;

    for(i=0; i<sz; i++)
    {
        tN = 0;

        for(j=0; j<sz; j++)
        {
            if(a[j] == a[i]) tN++;
        }

        if(tN > mN)
        {
            mN = tN;
            mId = a[i];
        }
    }

    return mId;
}

unsigned char majorityChar(unsigned char *a, unsigned int sz)
{
    unsigned int i, j;
    unsigned char mId = 0, mN = 0;
    unsigned int tN;

    for(i=0; i<sz; i++)
    {
        tN = 0;

        for(j=0; j<sz; j++)
        {
            if(a[j] == a[i]) tN++;
        }

        if(tN > mN)
        {
            mN = tN;
            mId = a[i];
        }
    }

    return mId;
}

/*!
 * \brief Keep the lowest distance in the array
 */
void keepLowest(unsigned int dist, unsigned int id)
{
    unsigned int i, j, tId, tDist, vId, vDist;

    for(i=0; i<N_KNN_ALPHABET; i++)
    {
        if(dist < loDist[i])
        {
            vId = id;
            vDist = dist;

            // right shift the array from position i
            for(j=i; j<N_KNN_ALPHABET; j++)
            {
                tId = loId[j];
                tDist = loDist[j];

                loId[j] = vId;
                loDist[j] = vDist;

                vId = tId;
                vDist = tDist;
            }

            // exit loop
            break;
        }
    }
}

/*!
 * \brief Compute the sum of element of img.
 */
unsigned long int sum(unsigned char *img)
{
    unsigned long int s = 0;
    unsigned char *p = &img[DICTIONNARY_IMG_SIZE];

    do
    {
        s += *p;
    }while(--p != img);

    return s;
}

/*!
 * \brief Find otsu threshold
 */
// From: http://www.hackchina.com/en/r/168276/OTSU.c__html
/*======================================================================*/
/*   OTSU global thresholding routine                                   */
/*   takes a 2D unsigned char array pointer, number of rows, and        */
/*   number of cols in the array. returns the value of the threshold    */
/*======================================================================*/
int otsuAlphabet(unsigned char *image)
{
    unsigned char *np;
    int thresholdValue=1;
    int ihist[256];

    int i, j, k;                            // various counters
    int n, n1, n2, gmin, gmax;
    double m1, m2, sum, csum, fmax, sb;

    memset(ihist, 0, sizeof(ihist));

    gmin=255; gmax=0;

    for(i=0; i<10; i++) {
        np = &image[i*10 + 1];
        for (j=0; j<10; j++) {
            ihist[*np]++;
            if(*np > gmax) gmax=*np;
            if(*np < gmin) gmin=*np;
            np++; /* next pixel */
        }
    }

    // set up everything
    sum = csum = 0.0;
    n = 0;

    for (k = 0; k <= 255; k++) {
        sum += (double) k * (double) ihist[k];
        n   += ihist[k];
    }

    if (!n) {
        // if n has no value, there is problems...
        fprintf (stderr, "NOT NORMAL thresholdValue = 160\n");
        return (160);
    }

    // do the otsu global thresholding method
    fmax = -1.0;
    n1 = 0;
    for (k = 0; k < 255; k++) {
        n1 += ihist[k];
        if (!n1) { continue; }
        n2 = n - n1;
        if (n2 == 0) { break; }
        csum += (double) k *ihist[k];
        m1 = csum / n1;
        m2 = (sum - csum) / n2;
        sb = (double) n1 *(double) n2 *(m1 - m2) * (m1 - m2);
        /* bbg: note: can be optimized. */
        if (sb > fmax) {
            fmax = sb;
            thresholdValue = k;
        }
    }

    return(thresholdValue);
}

/*!
 * \brief Set background to 255.
 */
void cleanBackground(unsigned char *img)
{
    unsigned char *p = &img[100];
    unsigned char threshold = otsuAlphabet(img);
    do
    {
        if(*p > threshold)
        {
            *p = 255;
        }
    }while(--p != img);
}

/*!
 * \brief Compute L2 norm of ||A-B||.
 */
unsigned int normL2(unsigned char *a, unsigned char *b)
{
    unsigned int d = 0;
    unsigned char *pa = &a[DICTIONNARY_IMG_SIZE];
    unsigned char *pb = &b[DICTIONNARY_IMG_SIZE];

    do
    {
        d += (*pa - *pb) * (*pa - *pb);
        --pa;
        --pb;
    }while(pa != a);

    return d;
}

/*!
 * \brief Clean background of all images in the dictionary.
 */
void initDictionnary()
{
    int i;

    for(i=0; i<DICTIONNARY_SIZE; ++i)
    {
        cleanBackground(&dictImg[DICTIONNARY_IMG_SIZE*i]);
    }
}

/*!
 * \brief Return letter found in 'img' array.
 */
unsigned char letter(unsigned char img[100])
{
    int i, rot;							// loop indices
    unsigned char classId = 0;			// Id of the letter
    unsigned int dist;					// temporary value
    unsigned int minDist = 255*255*100;	// max value
    unsigned char buf[100];		// temporary buffer
    unsigned char *ptr, *temp = buf;
    unsigned char L;

    if(sum(img)/255>90)
    {
        return '?';
    }

    // init KNN values
    for(i=0; i<N_KNN_ALPHABET; i++) loDist[i] = UINT_MAX;
    for(i=0; i<N_KNN_ALPHABET; i++) loId[i] = 0;

    cleanBackground(img);

    for(rot = 0; rot<4; rot++)
    {
        for(i=0; i<DICTIONNARY_SIZE; ++i)
                {
                        dist = normL2(img, &dictImg[DICTIONNARY_IMG_SIZE*i]);
                        keepLowest(dist, dictId[i]);
                        if(dist < minDist)
                        {
                                minDist = dist;
                                classId = dictId[i];
                        }
                }

        // don't rotate before exiting the loop
        if(rot != 4)
        {
                // rotate image
                rotate90clock(img, temp);

                // swap 'img' and 'temp'
                ptr = img;
                img = temp;
                temp = ptr;
        }
    }

    //printArray(loId, N_KNN_ALPHABET);
    L = majority(loId, N_KNN_ALPHABET);
    if(L == 154) return L;
    return L + 'A' - 1;
}

// Rotate image 90 clockwise
// Images index follow the rule pixel(row, col) = img[10*row + col]
// 'in' and 'out' cannot be the same array.
void rotate90clock(unsigned char in[200], unsigned char out[100])
{
        int i, j;
        int row, col;
        for(i=0; i<10; i++)
        {
                for(j=0; j<10; j++)
                {
                        row = j;
                        col = 9-i;
                        out[10*row + col] = in[10*i + j];
                }
        }
}

/**
 *
 */
AlphabetFilter::AlphabetFilter(QObject *parent)
    : Filter(parent)
{
    initDictionnary();

    reset();
}

/**
 *
 */
void AlphabetFilter::process()
{
    Letter = letter( Frame.data );
}

